import { StatusBar } from 'expo-status-bar';
import React, {useState} from 'react';
import { StyleSheet, View, Image, FlatList} from 'react-native';

import Card from './components/cards';
import poodle from './assets/cao_capa.jpg';
import doberman from './assets/cao_duvida.jpg';
import pincher from './assets/cao_e_gato_capa.jpg';
import icon from './assets/icon.png';

export default function App() {

  var desenhandoItens = ({ item  }) => {
    return <Card 
    nome={item.nome}
    img= {item.img}
    botao= {item.botao}
    />;
  }
  var itens =[
    {
      id: '1',
      nome: 'Poodle',
      img: './assets/cao_capa.jpg',
      botao: 'Adquirir o item',
    },
    {
      id: '2',
      nome: 'Doberman',
      img: {doberman},
      botao: 'Adquirir o item',
    },
    {
      id: '3',
      nome: 'Pincher',
      img: {pincher},
      botao: 'Adquirir o item',
    },
    {
      id: '4',
      nome: 'Pastor Alemão',
      img: {icon},
      botao: 'Adquirir o item',
    },
    {
      id: '5',
      nome: 'Pastor Belga',
      img: {icon},
      botao: 'Adquirir o item',
    },
    {
      id: '6',
      nome: 'Vira-lata',
      img: {icon},
      botao: 'Adquirir o item',
    },
  ]

  return (
     <View style={styles.container1}>
      <StatusBar style="auto" />
      <FlatList 
        data= {itens}
        renderItem= {desenhandoItens}
        keyExtractor={(item) => item.id}
      />
    </View> 
  );
}

const styles = StyleSheet.create({
  container1: {
    flex: 1,
    paddingTop: 20,
  },

});
